INSERT INTO `ideas_config` VALUES (1,'Coupon prefix','coupon_prefix','VitaCode',1),(2,'Coupon length random','coupon_length_random','10',1),(3,'Is cache enable','is_cache','0',1),(4,'Currency default','currency_default','1',1),(5,'weight base default','weight_based_default','1',1),(6,'Paypal id','paypal_id','',1),(7,'Paypal mode','paypal_mode','0',1),(8,'Stripe publish key','stripe_publish','',1),(9,'Stripe secret key','stripe_secret','',1),(10,'Does delete downloadable product link after one time download','download_once','1',1),(11,'Can customer download right after paying when checkout','download_right_after_checkout','1',1),(12,'Number minutes to cache','cache_minute','1',1),(13,'Send mail by function','mail_method','0',1),(14,'Paypal','paypal','0',1),(15,'Stripe','stripe','1',1),(16,'Convert Currency','convert_currency','1',1),(17,'Number product display in homepage each category','num_product_per_category','4',1),(18,'Checkout Success Url','checkout_ok_url','checkout-ok',1),(19,'Checkout Fail Url','checkout_fail_url','checkout-fail',1),(20,'Invoice Css','invoice_css','<style>\n    #invoice-div {\n        margin: 0 auto;\n        max-width: 1024px;\n    }\n    .table-invoice {\n        width: 100%;\n        border: 1px #cccccc solid;\n        margin-bottom: 20px;\n        border-collapse: collapse;\n    }\n    .table-invoice tr th{\n        border: 1px #cccccc solid;\n    }\n    .table-invoice tr td {\n        border-right: 1px #cccccc solid;\n    }\n    .table-invoice tr td {\n        padding-left: 10px;\n    }\n    .table-invoice tr th p {\n        float: left;\n        margin-left: 10px;\n        font-weight: bold;\n    }\n    .no-border-right {\n        border-right: none !important;\n    }\n    .table-product tr td {\n        border-bottom: 1px #cccccc solid;\n        padding: 10px;\n    }\n    .text-bold {\n        font-weight: bold;\n    }\n</style>',1),(21,'Invoice Template','invoice_template','<div id=\"invoice-div\">\n    <h3>INVOICE #{{ order.id }}</h3>\n    <table class=\"table-invoice\">\n        <thead>\n        <tr>\n            <th colspan=\"2\">Order Detail</p></th>\n        </tr>\n        </thead>\n        <tbody>\n        <tr>\n            <td>\n                Telephone 123456789<br/>\n                E-Mail admin@admin.to<br/>\n                Web Site: http://ideasshop.local<br/>\n            </td>\n            <td>\n                Date Added {{now}}<br/>\n                Order ID: {{ order.id }}<br/>\n                Payment Method : {{ order.payment_method_name }}<br/>\n                Shipping Method : {{ order.shipping_rule_name }}<br/>\n            </td>\n        </tr>\n\n        </tbody>\n    </table>\n    <table class=\"table-invoice\">\n        <thead>\n        <tr>\n            <th><p>Billing Address</p></th>\n            <th><p>Shipping Address</p></th>\n        </tr>\n        </thead>\n        <tbody>\n        <tr>\n            <td>{{ order.billing_name }}</td>\n            <td>{{ order.shipping_name }}</td>\n        </tr>\n        <tr>\n            <td>{{ order.billing_address }}</td>\n            <td>{{ order.shipping_address }}</td>\n        </tr>\n        <tr>\n            <td>{{ order.billing_phone }}</td>\n            <td>{{ order.shipping_phone }}</td>\n        </tr>\n        <tr>\n            <td>{{ order.billing_email }}</td>\n            <td>{{ order.shipping_email }}</td>\n        </tr>\n        <tr>\n            <td>Shipping :\n                {{ order.shipping_rule_name }}</td>\n            <td></td>\n        </tr>\n        </tbody>\n    </table>\n\n    <table class=\"table-invoice table-product\">\n        <thead>\n        <tr>\n            <th><p>Product</p></th>\n            <th><p>Quantity</p></th>\n            <th><p>Price after tax</p></th>\n            <th><p>Total</p></th>\n        </tr>\n        </thead>\n        <tbody>\n        {% for row in product %}\n        <tr>\n            <td>\n                {{ row.name }}\n            </td>\n            <td>{{ row.qty }}</td>\n            <td>{{ row.price_after_tax | displayPriceAndCurrency }}</td>\n            {% set priceWithQty = row.qty * row.price_after_tax %}\n            <td>{{ priceWithQty | displayPriceAndCurrency}}</td>\n        </tr>\n        {% endfor %}\n        <tr>\n            <td class=\"no-border-right\"></td>\n            <td class=\"no-border-right\"></td>\n            <td class=\"text-bold\">Shipping Cost</td>\n            <td>{{ shipping_cost | displayPriceAndCurrency }}</td>\n        </tr>\n        <tr>\n            <td class=\"no-border-right\"></td>\n            <td class=\"no-border-right\"></td>\n            <td class=\"text-bold\">Total</td>\n            <td>{{ total | displayPriceAndCurrency }}</td>\n        </tr>\n        </tbody>\n    </table>\n</div>',1),(22,'Homepage seo title','seo_title','Vita+Code',1),(23,'Homepage seo keyword','seo_keyword','vitacode, salud, ficha de salud, ',1),(24,'Homepage seo description','seo_description','Qué es VITACODE?\r\nEs una pulsera ultra liviana que contiene un código QR. Al escanearlo, se podrá ver una ficha completa con toda la información importante que la persona desee incorporar, tales como datos personales, contactos de emergencia, enfermedades, detalle de remedios, ubicación, etc., logrando entregar una información y una referencia vital al profesional de la salud respecto a procedimientos a seguir en caso de una emergencia.',1),(25,'Number of featured product displayed','number_featured_product','4',1),(26,'Number of bestseller product displayed','number_bestseller_product','4',1),(27,'Number of lastest product displayed','number_is_new_product','2',1),(28,'Is resize feature image in product list in backend','is_resize_image_product_list','0',1),(29,'Is Create default is product simple','is_create_product_type_simple','1',1);
